SET CLIENT_ENCODING TO UTF8;
SET STANDARD_CONFORMING_STRINGS TO ON;
BEGIN;
CREATE TABLE "world" (gid serial PRIMARY KEY,
"name" varchar(40),
"gmi_cntry" varchar(3),
"region" varchar(25));
SELECT AddGeometryColumn('','world','the_geom','4326','MULTIPOLYGON',2);
CREATE INDEX "world_the_geom_gist" ON "world" using gist ("the_geom" gist_geometry_ops);
COMMIT;
